import React from 'react';
import { connect } from 'react-redux';
import { selectStrength, selectBodybuilding } from '../../actions/goal';
import { Grid, Divider, Segment, Button, Image } from 'semantic-ui-react';
import { Link } from 'react-router-dom';

class Homepage extends React.Component {
	render(){
		return (
			<div>
				<h1>Four Walls of Iron</h1>
				<Segment>
					<Grid columns={2}>	
						<Grid.Column>
							<Image src={require('../Strength/StrengthImages/Strength.jpg')} />
							<Link to="/maxes">
								<Button onClick={this.props.selectStrength}>Strength</Button>
							</Link>
						</Grid.Column>
						<Grid.Column>
							<Link to="/maxes">
								<Button onClick={this.props.selectBodybuilding}>Bodybuilding</Button>
							</Link>
						</Grid.Column>
					</Grid>
					<Divider vertical>Or</Divider>
				</Segment>
			</div>
		)
	}
}

export default connect(null, { selectStrength, selectBodybuilding })(Homepage);
